void dft(volatile float* sample_real,volatile float* sample_imag,volatile float* temp_real,volatile float* temp_imag) {
#pragma HLS INTERFACE s_axilite port=return
#pragma HLS RESOURCE variable=sin_table core=ROM_1P_LUTRAM
#pragma HLS RESOURCE variable=cos_table core=ROM_1P_LUTRAM
#pragma HLS INTERFACE m_axi depth=256 port=temp_imag offset=slave
#pragma HLS INTERFACE m_axi depth=256 port=temp_real offset=slave
#pragma HLS INTERFACE m_axi depth=256 port=sample_imag offset=slave
#pragma HLS INTERFACE m_axi depth=256 port=sample_real offset=slave

	int i, j;
//	TEMP_TYPE w, tmp_w;
	TEMP_TYPE c, s;
//	float tmp_R, tmp_I;
	// Temporary arrays to hold the intermediate frequency domain results
//	TEMP_TYPE temp_real[N];
//	TEMP_TYPE temp_imag[N];

//	w = 0.0;
	// Calculate each frequency domain sample iteratively
	for (i = 0; i < N; i += 1) {
		temp_real[i] = 0;
		temp_imag[i] = 0;

		// (2 * pi * i)/N

//		tmp_w = 0.0;
		// Calculate the jth frequency sample sequentially
		for (j = 0; j < N; j += 1) {
			// Utilize HLS tool to calculate sine and cosine values
		if(i<=128 && j<=128){
			c = cos_table[i][j];
			s = -sin_table[i][j];
		} else if(j<=128){
			c = cos_table[256-i][j]; // cos symmetric  
			s = sin_table[256-i][j]; //sin symmetric with "-"
		} else if(i<=128){
			c = cos_table[i][256-j]; // cos symmetric  
			s = sin_table[i][256-j]; //sin symmetric with "-"
		} else{
			c = cos_table[256-i][256-j]; // cos symmetric  
			s = -sin_table[256-i][256-j]; //sin symmetric with "- * -"
		};
			// Multiply the current phasor with the appropriate input sample and keep
			// running sum
			temp_real[i] += (sample_real[j] * c - sample_imag[j] * s);
			temp_imag[i] += (sample_real[j] * s + sample_imag[j] * c);
//			printf("i=%d, diff=%32f\n", i, tmp_w - j*w);
//			tmp_w = tmp_w + w;

		}
//		out_real->write(temp_real[i]);
//		out_imag->write(temp_imag[i]);
//		w += freq;
	}

	// Perform an inplace DFT, i.e., copy result into the input arrays
//	for (i = 0; i < N; i += 1) {
//		sample_real[i] = temp_real[i];
//		sample_imag[i] = temp_imag[i];
//	}
}
